 un progetto che nasce dalla collaborazione tra Inail Direzione territoriale Perugia-Terni ed  Enti Bilaterali del Terziario e del Turismo dell’Umbria, con l’obiettivo comune di ridurre i rischi lavorativi legati a: posture incongrue, movimenti scorretti, postazioni di lavoro, sovraccarico degli arti superiori. A tal fine il progetto si propone di far conoscere e adottare i giusti modi di agire e di reagire a determinate situazioni di rischio, anche attraverso l’adozione di diverse soluzioni organizzative negli ambienti di lavoro. '),(5721,487,'_paragrafo_uno','field_64b556f53450a'),(5722,487,'titolo_due','Le fasi del progetto'),(5723,487,'_titolo_due','field_64b557c73450b'),(5724,487,'passi_uno','Valuta il rischio nel tuo lavoro'),(5725,487,'_passi_uno','field_64b558383450c'),(5726,487,'descrizione_uno','Compila il questionario per sapere a quale fascia di rischio appartieni (bastano due minuti)'),(5727,487,'_descrizione_uno','field_64b558443450d'),(5728,487,'passi_due','Aree di rischio'),(5729,487,'_passi_due','field_64b5587c3450e'),(5730,487,'descrizione_due','Informati e previeni, guarda le immagini e i video per conoscere i rischi e i comportamenti da adottare'),(5731,487,'_descrizione_due','field_64b558853450f'),(5732,487,'passi_tre','Test '),(5733,487,'_passi_tre','field_64b5588e34510'),(5734,487,'descrizione_tre','Mettiti alla prova, verifica cosa hai imparato (bastano tre minuti)'),(5735,487,'_descrizione_tre','field_64b5589a34511'),(5736,487,'titolo_tre','Aree di rischio'),(5737,487,'_titolo_tre','field_64b55b1934512'),(5738,487,'sottotitolo_tre','Scopri i comportamenti e le posture che possono mettere a rischio la tua salute'),(5739,487,'_sottotitolo_tre','field_64b55b9e34513'),(5740,487,'paragrafo_tre','Immagini e video ti illustrano le diverse situazioni di lavoro mettendo a confronto comportamenti sbagliati con quelli corretti.'),(5741,487,'_paragrafo_tre','field_64b55bc334514'),(5742,487,'title','Abbi cura di te'),(5743,487,'_title','field_64b107ad2e7