tti, postazioni di lavoro, sovraccarico degli arti superiori. A tal fine il progetto si propone di far conoscere e adottare i giusti modi di agire e di reagire a determinate situazioni di rischio, anche attraverso l’adozione di diverse soluzioni organizzative negli ambienti di lavoro. '),(5792,488,'_paragrafo_uno','field_64b556f53450a'),(5793,488,'titolo_due','Le fasi del progetto'),(5794,488,'_titolo_due','field_64b557c73450b'),(5795,488,'passi_uno','Valuta il rischio nel tuo lavoro'),(5796,488,'_passi_uno','field_64b558383450c'),(5797,488,'descrizione_uno','Compila il questionario per sapere a quale fascia di rischio appartieni (bastano due minuti)'),(5798,488,'_descrizione_uno','field_64b558443450d'),(5799,488,'passi_due','Aree di rischio'),(5800,488,'_passi_due','field_64b5587c3450e'),(5801,488,'descrizione_due','Informati e previeni, guarda le immagini e i video per conoscere i rischi e i comportamenti da adottare'),(5802,488,'_descrizione_due','field_64b558853450f'),(5803,488,'passi_tre','Test '),(5804,488,'_passi_tre','field_64b5588e34510'),(5805,488,'descrizione_tre','Mettiti alla prova, verifica cosa hai imparato (bastano tre minuti)'),(5806,488,'_descrizione_tre','field_64b5589a34511'),(5807,488,'titolo_tre','Aree di rischio'),(5808,488,'_titolo_tre','field_64b55b1934512'),(5809,488,'sottotitolo_tre','Scopri i comportamenti e le posture che possono mettere a rischio la tua salute'),(5810,488,'_sottotitolo_tre','field_64b55b9e34513'),(5811,488,'paragrafo_tre','Immagini e video ti illustrano le diverse situazioni di lavoro mettendo a confronto comportamenti sbagliati con quelli corretti.'),(5812,488,'_paragrafo_tre','field_64b55bc334514'),(5813,488,'title','Abbi cura di te'),(5814,488,'_title','field_64b107ad2e772'),(5815,488,'sottotitolo','Come prevenire i rischi lavorativi collegati a posture e movimenti non corretti, nel settore del turismo.'),(5816,488,'_sottotitolo','field_64b5548a34507'),(5817,488,'paragrafo','Un modo intuitivo e immediato per imparare