7,640,'_sottotitolo_uno','field_64b556ef34509'),(6758,640,'paragrafo_uno','“Abbi cura di te” è un progetto che nasce dalla collaborazione tra Inail Direzione territoriale Perugia-Terni ed  Enti Bilaterali del Terziario e del Turismo dell’Umbria, con l’obiettivo comune di ridurre i rischi lavorativi legati a: posture incongrue, movimenti scorretti, postazioni di lavoro, sovraccarico degli arti superiori. A tal fine il progetto si propone di far conoscere e adottare i giusti modi di agire e di reagire a determinate situazioni di rischio, anche attraverso l’adozione di diverse soluzioni organizzative negli ambienti di lavoro. '),(6759,640,'_paragrafo_uno','field_64b556f53450a'),(6760,640,'titolo_due','Le fasi del progetto'),(6761,640,'_titolo_due','field_64b557c73450b'),(6762,640,'passi_uno','Valuta il rischio nel tuo lavoro'),(6763,640,'_passi_uno','field_64b558383450c'),(6764,640,'descrizione_uno','Compila il questionario per sapere a quale fascia di rischio appartieni (bastano due minuti)'),(6765,640,'_descrizione_uno','field_64b558443450d'),(6766,640,'passi_due','Aree di rischio'),(6767,640,'_passi_due','field_64b5587c3450e'),(6768,640,'descrizione_due','Informati e previeni, guarda le immagini e i video per conoscere i rischi e i comportamenti da adottare'),(6769,640,'_descrizione_due','field_64b558853450f'),(6770,640,'passi_tre','Test '),(6771,640,'_passi_tre','field_64b5588e34510'),(6772,640,'descrizione_tre','Mettiti alla prova, verifica cosa hai imparato (bastano tre minuti)'),(6773,640,'_descrizione_tre','field_64b5589a34511'),(6774,640,'titolo_tre','Aree di rischio'),(6775,640,'_titolo_tre','field_64b55b1934512'),(6776,640,'sottotitolo_tre','Scopri i comportamenti e le posture che possono mettere a rischio la tua salute'),(6777,640,'_sottotitolo_tre','field_64b55b9e34513'),(6778,640,'paragrafo_tre','Immagini e video ti illustrano le diverse situazioni di lavoro mettendo a confronto comportamenti sbagliati con quelli corretti.'),(6779,640,'_paragrafo_tre','fi