a e alle braccia comunicalo alle tue figure di riferimento per la sicurezza (es medico competente, preposto, RLS etc).'),(7704,686,'_legenda_0_legenda','field_64ba7fc17eb75'),(7705,686,'legenda_0_fascia_0_fascia_verde','1'),(7706,686,'_legenda_0_fascia_0_fascia_verde','field_64ba7fc17eb78'),(7707,686,'legenda_0_fascia_0_fascia_giallo','0'),(7708,686,'_legenda_0_fascia_0_fascia_giallo','field_64ba7fc17eb79'),(7709,686,'legenda_0_fascia_0_fascia_arancione','0'),(7710,686,'_legenda_0_fascia_0_fascia_arancione','field_64ba7fc17eb7a'),(7711,686,'legenda_0_fascia_0_fascia_rossa','0'),(7712,686,'_legenda_0_fascia_0_fascia_rossa','field_64ba7fc17eb7b'),(7713,686,'legenda_0_fascia','1'),(7714,686,'_legenda_0_fascia','field_64ba7fc17eb76'),(7715,686,'legenda_1_legenda','Nel tuo lavoro ci possono essere fasi a rischio basso per schiena e arti superiori, ma se hai dolori alla schiena e alle braccia comunicalo alle tue figure di riferimento per la sicurezza (es medico competente, preposto, RLS etc)'),(7716,686,'_legenda_1_legenda','field_64ba7fc17eb75'),(7717,686,'legenda_1_fascia_0_fascia_verde','0'),(7718,686,'_legenda_1_fascia_0_fascia_verde','field_64ba7fc17eb78'),(7719,686,'legenda_1_fascia_0_fascia_giallo','1'),(7720,686,'_legenda_1_fascia_0_fascia_giallo','field_64ba7fc17eb79'),(7721,686,'legenda_1_fascia_0_fascia_arancione','0'),(7722,686,'_legenda_1_fascia_0_fascia_arancione','field_64ba7fc17eb7a'),(7723,686,'legenda_1_fascia_0_fascia_rossa','0'),(7724,686,'_legenda_1_fascia_0_fascia_rossa','field_64ba7fc17eb7b'),(7725,686,'legenda_1_fascia','1'),(7726,686,'_legenda_1_fascia','field_64ba7fc17eb76'),(7727,686,'legenda_2_legenda','Nel tuo lavoro ci possono essere fasi a rischio medio per schiena e arti superiori, se hai dolori alla schiena e alle braccia comunicalo alle tue figure di riferimento per la sicurezza (es medico competente, preposto, RLS etc)\r\n\r\nChiedi al medico competente, se possibile, di alternate il compito con altri compiti\r\ne/o di fare nel turno 1 o